module.exports = function() {
    const sample = 'dabAcCaCBAcCcaDA';
    const input = '';
    const letters = 'abcdefghijklmnopqrstuvwxyz'.split('');

    function reduce(input) {
        let previousLength = 0;
        while (previousLength !== input.length) {
            previousLength = input.length;
            letters.forEach(letter => {
                input = input.replace(letter + letter.toUpperCase(), '');
                input = input.replace(letter.toUpperCase() + letter, '');
            });
        }
        return input;
    }

    let shortest = input.length;
    letters.forEach(letter => {
        let data = input;
        data = data.replace(new RegExp(letter, 'gi'), '');
        data = reduce(data);
        shortest = data.length < shortest ? data.length : shortest;
    });

    return shortest;
}
